import{_ as t,c as e,o as a,a4 as r}from"./chunks/framework.DpC1ZpOZ.js";const m=JSON.parse('{"title":"《HelloGitHub》第 17 期","description":"","frontmatter":{},"headers":[],"relativePath":"HelloGitHub17.md","filePath":"HelloGitHub17.md"}'),i={name:"HelloGitHub17.md"},o=r('<h1 id="《hellogithub》第-17-期" tabindex="-1">《HelloGitHub》第 17 期 <a class="header-anchor" href="#《hellogithub》第-17-期" aria-label="Permalink to &quot;《HelloGitHub》第 17 期&quot;">​</a></h1><blockquote><p>兴趣是最好的老师，<strong>HelloGitHub</strong> 让你对编程感兴趣！</p></blockquote><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/cover.jpg" style="max-width:100%;"></p><h2 id="目录" tabindex="-1">目录 <a class="header-anchor" href="#目录" aria-label="Permalink to &quot;目录&quot;">​</a></h2><p>点击右上角的 <strong>「目录」</strong> 图标打开目录，获得更好的阅读体验。</p><p><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/catalog.png" alt=""></p><p><strong>Tips</strong>：如果遇到图片刷不出来的情况，<a href="https://hellogithub.com/periodical/volume/17" target="_blank" rel="noreferrer">点击</a> 换一种浏览方式。</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/weixin.png" style="max-width:30%;"><br> 关注「HelloGitHub」公众号，第一时间收到推送 </p><h2 id="内容" tabindex="-1">内容 <a class="header-anchor" href="#内容" aria-label="Permalink to &quot;内容&quot;">​</a></h2><blockquote><p><strong>以下为本期内容</strong>｜每个月 <strong>28</strong> 号更新</p></blockquote><h3 id="c-项目" tabindex="-1">C# 项目 <a class="header-anchor" href="#c-项目" aria-label="Permalink to &quot;C# 项目&quot;">​</a></h3><p>1、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/asheigithub/apple-juice-actionscript" target="_blank" rel="noreferrer">apple-juice-actionscript</a>：NET2.0 实现的 AS3（第三代 Flash 脚本）解释器，可用于嵌入 unity 做热更。一个完整的脚本语言解释执行系统，从语法树分析开始一直到实际执行</p><p>2、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/MaterialDesignInXAML/MaterialDesignInXamlToolkit" target="_blank" rel="noreferrer">MaterialDesignInXamlToolkit</a>：谷歌 Material Design 设计风格控件库</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/30474266.png" style="max-width:80%;"></p><h3 id="css-项目" tabindex="-1">CSS 项目 <a class="header-anchor" href="#css-项目" aria-label="Permalink to &quot;CSS 项目&quot;">​</a></h3><p>3、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/jgthms/bulma" target="_blank" rel="noreferrer">bulma</a>：UI框架，样式比 Bootstrap 更加扁平化。源码文件结构清晰，通过源码可以学到 UI 框架架构。<a href="http://bulma.io/expo/" target="_blank" rel="noreferrer">使用 bulma 的网站展示</a></p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/50264296.png" style="max-width:80%;"></p><h3 id="go-项目" tabindex="-1">Go 项目 <a class="header-anchor" href="#go-项目" aria-label="Permalink to &quot;Go 项目&quot;">​</a></h3><p>4、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/casbin/casbin" target="_blank" rel="noreferrer">casbin</a>：访问控制开源库，支持 ACL/RBAC/ABAC 等访问控制模型，支持 MySQL/NoSQL 等存储方式</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/87617508.png" style="max-width:80%;"></p><p>5、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/dgrijalva/jwt-go" target="_blank" rel="noreferrer">jwt-go</a>：Golang 实现 JSON Web Tokens (JWT)</p><h3 id="java-项目" tabindex="-1">Java 项目 <a class="header-anchor" href="#java-项目" aria-label="Permalink to &quot;Java 项目&quot;">​</a></h3><p>6、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/NLPchina/elasticsearch-sql" target="_blank" rel="noreferrer">elasticsearch-sql</a>：用 SQL 查询 Elasticsearch</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/23282991.png" style="max-width:80%;"></p><p>7、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/maning0303/GankMM" target="_blank" rel="noreferrer">GankMM</a>：干货集中营 Android 客户端。每天一张美女图片，一个视频短片，若干Android，iOS等程序干货，周一到周五每天更新，数据全部由 <a href="http://gank.io/" target="_blank" rel="noreferrer">干货集中营</a> 提供。项目简单完整，涉及内容全面，利于学习 Android 开发的技巧</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/54034810.png" style="max-width:80%;"></p><p>8、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/JessYanCoding/MVPArms" target="_blank" rel="noreferrer">MVPArms</a>：整合了大量主流开源项目的 Android Mvp 快速搭建框架。包含 Dagger2、Retrofit、Rxjava 等 Rx 系三方库，并且提供 UI 自适应方案，本框架将它们结合起来。文档详尽、成熟稳定的 Android MVP 解决方案</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/65073648.png" style="max-width:80%;"></p><h3 id="javascript-项目" tabindex="-1">JavaScript 项目 <a class="header-anchor" href="#javascript-项目" aria-label="Permalink to &quot;JavaScript 项目&quot;">​</a></h3><p>9、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/gkajs/gka" target="_blank" rel="noreferrer">gka</a>：简单、高效的帧动画生成工具，图片处理工具。</p><ul><li>一键式：图片文件批量序列化重命名，生成帧动画文件，支持预览</li><li>性能佳：支持相同帧图片复用✓，图片空白裁剪✓，合图模式✓，图片压缩✓</li><li>多模板：内置多种文件输出模板，支持自定义模板</li></ul><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/77895105.gif" style="max-width:80%;"></p><p>10、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/chinesedfan/parrot-mocker-web" target="_blank" rel="noreferrer">parrot-mocker-web</a>：小巧的 mock 服务器，配合 Chrome 插件可以轻松地拦截或 mock 页面上的 xhr/jsonp/fetch 请求。不需要侵入页面本身代码，让前端同学在后端接口没有 ready 或者难以模拟数据的时候，继续开心地开发玩耍</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/86557428.png" style="max-width:80%;"></p><p>11、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/t4t5/sweetalert" target="_blank" rel="noreferrer">sweetalert</a>：纯 JS 写成的 alert 组件，很多公司都在使用的项目。源代码使用了 ES6 进行了重构，使得项目结构更加清晰。可以通过学习其项目结构可以更好的了解 JS 组件的文件结构，分析其源码可以学习如何使用原生 JS 操作 DOM 的高级技巧</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/24635156.gif" style="max-width:80%;"></p><p>12、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/ncase/trust" target="_blank" rel="noreferrer">trust</a>：一个合作博弈论的互动讲解手册，<a href="https://www.sekai.co/trust/" target="_blank" rel="noreferrer">中文版在线试玩</a></p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/98217892.png" style="max-width:80%;"></p><p>13、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/denysdovhan/wtfjs" target="_blank" rel="noreferrer">wtfjs</a>：JavaScript 有趣和棘手（坑爹？）的示例</p><h3 id="kotlin-项目" tabindex="-1">Kotlin 项目 <a class="header-anchor" href="#kotlin-项目" aria-label="Permalink to &quot;Kotlin 项目&quot;">​</a></h3><p>14、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/LRH1993/Eyepetizer-in-Kotlin" target="_blank" rel="noreferrer">Eyepetizer-in-Kotlin</a>：一款使用 kotlin 语言开发的 App。适合初学者作为学习 kotlin 语言的一个项目，可以在做项目的同时体验到 kotlin 语言的优点</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/95836274.png" style="max-width:80%;"></p><h3 id="python-项目" tabindex="-1">Python 项目 <a class="header-anchor" href="#python-项目" aria-label="Permalink to &quot;Python 项目&quot;">​</a></h3><p>15、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/coleifer/huey" target="_blank" rel="noreferrer">huey</a>：结合 redis 实现的轻量任务队列，但是支持功能还是很多的：</p><ul><li>多进程、多线程、协程</li><li>任务定时执行</li><li>任务执行失败重试</li><li>结果存储</li></ul><p>16、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/jhao104/proxy_pool" target="_blank" rel="noreferrer">proxy_pool</a>：基于 Python 的自建代理 IP 池服务，通过网络爬虫抓取互联网上免费的代理 IP，本地校验、剔除失效的代理IP，从而实现高可用的代理 IP 池。最后使用 Flask 搭建提供代理 IP 服务，包括代理池刷新、无效代理删除、代理获取等。该项目设计文档详细、模块结构简明易懂，同时适合爬虫新手更好的学习爬虫技术</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/74762106.png" style="max-width:80%;"></p><p>17、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/pyecharts/pyecharts" target="_blank" rel="noreferrer">pyecharts</a>：Echarts+Python 实现的一个用于生成 Echarts 图表的类库</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/95067884.gif" style="max-width:80%;"></p><p>18、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/tankywoo/simiki" target="_blank" rel="noreferrer">simiki</a>：一个简单的个人 Wiki 框架，便于快速搭建 Wiki 页。使用 Markdown 书写 Wiki, 生成静态 HTML 页面。Wiki 源文件按目录分类存放, 方便管理维护。<a href="http://simiki.org/zh-docs/" target="_blank" rel="noreferrer">中文文档</a></p><p>19、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/SpiderClub/weibospider" target="_blank" rel="noreferrer">weibospider</a>：分布式微博爬虫，支持快速抓取和稳定抓取两种运行模式。项目模块逻辑清晰、注释丰富、便于定制化自己的需求。同时，对于小白用户，可以通过演示视频快速入门，也提供QQ群答疑，已经持续维护一年多。靠谱的项目，小伙伴们要赶快上车～</p><p align="center"><img src="https://raw.githubusercontent.com/521xueweihan/img/master/hellogithub/17/62032720.png" style="max-width:80%;"></p><h3 id="其它" tabindex="-1">其它 <a class="header-anchor" href="#其它" aria-label="Permalink to &quot;其它&quot;">​</a></h3><p>20、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/leereilly/games" target="_blank" rel="noreferrer">games</a>：GitHub 上游戏项目的合集</p><p>21、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/ziishaned/learn-regex" target="_blank" rel="noreferrer">learn-regex</a>：易学的正则表达式教程，<a href="https://github.com/zeeshanu/learn-regex/blob/master/README-cn.md" target="_blank" rel="noreferrer">中文</a></p><p>22、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/zdhxiong/Material-Design-Chinese" target="_blank" rel="noreferrer">Material-Design-Chinese</a>：Material Design 官方文档的中文翻译，保留了原版网站的样式，并保持和官方文档同步更新</p><p>23、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/lining0806/PythonSpiderNotes" target="_blank" rel="noreferrer">PythonSpiderNotes</a>：Python 爬虫入门教程</p><p>24、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/SecWiki/sec-chart" target="_blank" rel="noreferrer">sec-chart</a>：安全思维导图集合</p><h3 id="开源书籍" tabindex="-1">开源书籍 <a class="header-anchor" href="#开源书籍" aria-label="Permalink to &quot;开源书籍&quot;">​</a></h3><p>25、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/jvns/pandas-cookbook" target="_blank" rel="noreferrer">pandas-cookbook</a>：pandas cookbook（英文）</p><p>26、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/nfmcclure/tensorflow_cookbook" target="_blank" rel="noreferrer">tensorflow_cookbook</a>：Tensorflow cookbook（英文）</p><h3 id="机器学习" tabindex="-1">机器学习 <a class="header-anchor" href="#机器学习" aria-label="Permalink to &quot;机器学习&quot;">​</a></h3><p>27、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/vahidk/EffectiveTensorflow" target="_blank" rel="noreferrer">EffectiveTensorflow</a>：TensorFlow 最佳实践</p><p>28、<a href="https://hellogithub.com/periodical/statistics/click?target=https://github.com/astorfi/TensorFlow-World" target="_blank" rel="noreferrer">TensorFlow-World</a>：简单易用的 TensorFlow 教程</p><p align="center"><a href="https://github.com/521xueweihan/HelloGitHub/blob/master/content/HelloGitHub16.md">『上一期』</a> | <a href="https://github.com/521xueweihan/HelloGitHub/issues/899">反馈和建议</a> | <a href="https://github.com/521xueweihan/HelloGitHub/blob/master/content/HelloGitHub18.md">『下一期』</a></p><hr><p align="center"> 👉 <a href="https://hellogithub.com/periodical">来！推荐开源项目</a> 👈<br> 微信中搜：<strong>HelloGitHub</strong> 关注公众号<br> 不仅能第一时间收到推送，还有回馈粉丝的活动<br> 如果文中的图刷不出来，可以点击 <a href="https://hellogithub.com/periodical/volume/17">这里</a>。 </p><h2 id="赞助" tabindex="-1">赞助 <a class="header-anchor" href="#赞助" aria-label="Permalink to &quot;赞助&quot;">​</a></h2><table><thead><tr><th align="center" style="width:80px;"><a href="https://www.ucloud.cn/site/active/kuaijiesale.html?utm_term=logo&amp;utm_campaign=hellogithub&amp;utm_source=otherdsp&amp;utm_medium=display&amp;ytag=github_hellogithub_otherdsp_display"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/ucloud.png" width="60px"><br><sub>UCloud</sub><br><sub>超值的全球云服务</sub></a></th><th align="center" style="width:80px;"><a href="https://www.upyun.com/"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/upyun.png" width="60px"><br><sub>CDN</sub><br><sub>开启全网加速</sub></a></th><th align="center" style="width:80px;"><a href="https://github.com/OpenIMSDK/Open-IM-Server"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/im.png" width="60px"><br><sub>OpenIM</sub><br><sub>开源IM力争No.1</sub></a></th><th align="center" style="width:80px;"><a href="https://apifox.cn/a103hello"><img src="https://raw.githubusercontent.com/521xueweihan/img_logo/master/logo/apifox.png" width="60px"><br><sub>Apifox</sub><br><sub>比 Postman 更强大</sub></a></th></tr></thead></table><h2 id="声明" tabindex="-1">声明 <a class="header-anchor" href="#声明" aria-label="Permalink to &quot;声明&quot;">​</a></h2><p><a rel="license" href="https://creativecommons.org/licenses/by-nc-nd/4.0/deed.zh"><img alt="知识共享许可协议" style="border-width:0;" src="https://licensebuttons.net/l/by-nc-nd/4.0/88x31.png"></a><br>本作品采用 <a rel="license" href="https://creativecommons.org/licenses/by-nc-nd/4.0/deed.zh">署名-非商业性使用-禁止演绎 4.0 国际</a> 进行许可。</p>',71),l=[o];function h(s,c,n,p,g,u){return a(),e("div",null,l)}const d=t(i,[["render",h]]);export{m as __pageData,d as default};
